#define SHORTEST_CODE 5


/* The decoder is optimized for the common case.  Most of the time, we decode
 * data whose encoding is 16 bits or shorter.  This allows us to use a 64 KB
 * table indexed by two bytes of input which outputs, 1, 2, or 3 bytes at a
 * time.
 *
 * In the case a longer code is encoutered, we fall back to the original
 * Huffman decoder that supports all code lengths.
 */
int
lshpack_dec_huff_decode (const unsigned char *src, int src_len,
                                            unsigned char *dst, int dst_len)
{
    unsigned char *const orig_dst = dst;
    const unsigned char *const src_end = src + src_len;
    unsigned char *const dst_end = dst + dst_len;
    uint64_t buf;
    unsigned avail_bits, len;
    struct hdec hdec;
    uint16_t idx;
    int r;

    buf = 0;
    avail_bits = 0;
    if (src + 8 <= src_end)
    {
        goto first_fill;
  fill_fast:
        switch ((64 - avail_bits) >> 3)
        {
        case 8:
            buf <<= 8;
  first_fill:
            buf |= (uint64_t) *src++;
        case 7:
            buf <<= 8;
            buf |= (uint64_t) *src++;
        default:
            buf <<= 48;
            buf |= (uint64_t) *src++ << 40;
            buf |= (uint64_t) *src++ << 32;
            buf |= (uint64_t) *src++ << 24;
            buf |= (uint64_t) *src++ << 16;
            buf |= (uint64_t) *src++ <<  8;
            buf |= (uint64_t) *src++ <<  0;
        }
        avail_bits += (64 - avail_bits) >> 3 << 3;
    }
    else if (src < src_end)
    {
        do
        {
  fill_slow:
            buf <<= 8;
            buf |= (uint64_t) *src++;
            avail_bits += 8;
        }
        while (src < src_end && avail_bits < 57);
    }
    else
        return 0;

    if (dst_end - dst >= (ptrdiff_t) (8 * sizeof(buf) / SHORTEST_CODE)
                                                        && avail_bits >= 16)
    {
        /* Fast loop: don't check destination bounds; use the fact that all
         * table entries below 0xFFFE are valid.
         */
        do
        {
            idx = buf >> (avail_bits - 16);
            if (idx < 0xFFFE)
            {
                hdec = hdecs[idx];
                dst[0] = hdec.out[0];
                dst[1] = hdec.out[1];
                dst[2] = hdec.out[2];
                dst += hdec.lens & 3;
                avail_bits -= hdec.lens >> 2;
            }
            else
                goto slow_pass;
        }
        while (avail_bits >= 16);
    }
    else
        while (avail_bits >= 16)
        {
            idx = buf >> (avail_bits - 16);
            hdec = hdecs[idx];
            len = hdec.lens & 3;
            if (len && dst + len <= dst_end)
            {
                switch (len)
                {
                case 3:
                    *dst++ = hdec.out[0];
                    *dst++ = hdec.out[1];
                    *dst++ = hdec.out[2];
                    break;
                case 2:
                    *dst++ = hdec.out[0];
                    *dst++ = hdec.out[1];
                    break;
                default:
                    *dst++ = hdec.out[0];
                    break;
                }
                avail_bits -= hdec.lens >> 2;
            }
            else if (dst + len > dst_end)
                return -2;
            else
                goto slow_pass;
        }

    if (src + 8 <= src_end)
        goto fill_fast;
    if (src < src_end)
        goto fill_slow;

    if (avail_bits >= SHORTEST_CODE)
    {
        idx = buf << (16 - avail_bits);
        idx |= (1 << (16 - avail_bits)) - 1;    /* EOF */
        if (idx == 0xFFFF && avail_bits < 8)
            goto end;
        /* If a byte or more of input is left, this mean there is a valid
         * encoding, not just EOF.
         */
        hdec = hdecs[idx];
        len = hdec.lens & 3;
        if (len && dst + len <= dst_end)
        {
            switch (len)
            {
            case 3:
                *dst++ = hdec.out[0];
                *dst++ = hdec.out[1];
                *dst++ = hdec.out[2];
                break;
            case 2:
                *dst++ = hdec.out[0];
                *dst++ = hdec.out[1];
                break;
            default:
                *dst++ = hdec.out[0];
                break;
            }
            avail_bits -= hdec.lens >> 2;
        }
        else if (dst + len > dst_end)
            return -2;
        else
            /* This must be an invalid code, otherwise it would have fit */
            return -1;
    }

    if (avail_bits > 0)
    {
        if (((1u << avail_bits) - 1) != (buf & ((1u << avail_bits) - 1)))
            return -1;  /* Not EOF as expected */
    }

  end:
    return dst - orig_dst;

  slow_pass:
    /* Find previous byte boundary and finish decoding thence. */
    while ((avail_bits & 7) && dst > orig_dst)
        avail_bits += encode_table[ *--dst ].bits;
    assert((avail_bits & 7) == 0);
    src -= avail_bits >> 3;
    r = lshpack_dec_huff_decode_full(src, src_end - src, dst, dst_end - dst);
    if (r >= 0)
        return dst - orig_dst + r;
    else
        return r;
}
